import { BrowserRouter as Route, Router, Routes, Link } from "react-router-dom";
import Cart from "./compoment/Cart";
import Delivery from "./compoment/Delivery";
import Press from "./compoment/Press";
import Shop from "./compoment/Shop";

export default function App() {
  return <Box />;
}

function Box() {
  return (
    // <Router>
    <section>
      <Main />
      <Routes>
        <Route path="/press" element={<Press />} />
      </Routes>
      <Forimg />
      <Discover />
      <Menu />
      <MenuItem />
      <Footer />
    </section>
    // </Router>
  );
}

function Main() {
  return (
    <nav>
      <div className="main1">
        <div>
          <p>Main</p>
        </div>

        <div className="about-sec">
          <p>
            <a href="#menu">Menu</a>
          </p>
          <p>Shop</p>

          <p className="press">
            <Link to={"/press"}>Press</Link>
          </p>
        </div>

        <div className="deli-sec">
          <p className="delivery">Delivery</p>
